import React from 'react';
import style from './AvailableMeals.module.css';
import Card from '../UI/Card';
import MealsItem from './MealsItem/MealsItem';
import useHttp from '../../hooks/useHttp';


const AvailableMeals = () => {
 const {data} = useHttp('https://react-movies-http-d18ef-default-rtdb.asia-southeast1.firebasedatabase.app/Meals.json')

  const mealList = a.map(meal => <MealsItem name={meal.name} desc={meal.description} price={meal.price} id={meal.id} key={meal.id}/>)
  return (
    <section className={style.meals}>
      <Card>
        <ul>
          {mealList}
        </ul>
      </Card>
    </section>
  )
}

export default AvailableMeals;
